import React from "react";
import "../css/Your_Carts.css";

export default function Your_Carts() {
  return (
    <div>
      <div className="Yourcarts">
        <div className="C-1">
            <ul>
                <li><svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-x-circle-fill" viewBox="0 0 16 16">
  <path d="M16 8A8 8 0 1 1 0 8a8 8 0 0 1 16 0zM5.354 4.646a.5.5 0 1 0-.708.708L7.293 8l-2.647 2.646a.5.5 0 0 0 .708.708L8 8.707l2.646 2.647a.5.5 0 0 0 .708-.708L8.707 8l2.647-2.646a.5.5 0 0 0-.708-.708L8 7.293 5.354 4.646z"/>
</svg></li>
            </ul>
        </div>

        <div className="C-2"></div>

        <div className="C-3"></div>

        <div className="C-4"></div>
      </div>
    </div>
  );
}
